import React from 'react';
import ChatBot from 'react-simple-chatbot'

const steps = [
  {
    id: '0',
    message: 'Hola'
  }
]

class App extends React.Component{
  render(){
    return(
      <ChatBot steps={[
        id: 'hello-world',
      message: 'Hello World!',
      end: true,
      ]}></ChatBot>
    )
  }
}

export default App;
